import React, { useState } from "react";
import { Input } from "reactstrap";


class UserInput extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            name: null,
            id: null
        }
    }


    handleSubmit() {
        this.setState
    }


    render() {
        return (
            <div>
                <form>
                    <label>
                        Name:
                        <input type="text" defaultValue="name" value={this.state.name}/> 
                    </label>
                    <label>
                        ID:
                        <input type="text" defaultValue="id" value={this.state.id}/>
                    </label>
                    <button onClick={handleSubmit}>Submit</button>
                </form>
            </div>
        );
    }
};

export default UserInput;
